const initialState = {
    check: true
  }
 export const check = (state = initialState, action) => {
      switch (action.type){
          case 'CHECK_BOX':
              return [
                ...state,
                {
                    check: !action.check
                }
                
            ]
          default:
              return state
      }
  }

  export default check
